import React from "react";
import { Link } from "react-router-dom";

const Cocktail = () => {
	return (
		<section className="section cocktail-section">
			<Link to="/">back home</Link>
			<h2 className="section-title"></h2>
		</section>
	);
};

export default Cocktail;
